	const std::vector<GroupInfo>& SceneInfos::GetLevelGroups()
	{
		return sLevelGroups;
	}

	const std::vector<SceneInfo>& SceneInfos::GetLevelsByGroup(const GroupInfo& Group)
	{
		return sLevelsByGroup[Group.GroupKey];
	}

	GroupInfo* SceneInfos::GetLevelGroupByKey(const std::string& GroupKey)
	{
		return sLevelGroupsByKey[GroupKey];
	}

	SceneInfo* SceneInfos::GetLevelByKey(const std::string& GroupKey, const std::string& SceneKey)
	{
		return sLevelsByKey[GroupKey][SceneKey];
	}

	const std::vector<GroupInfo>& SceneInfos::GetEntityGroups()
	{
		return sEntityGroups;
	}

	const std::vector<SceneInfo>& SceneInfos::GetEntitiesByGroup(const GroupInfo& Group)
	{
		return sEntitiesByGroup[Group.GroupKey];
	}

	GroupInfo* SceneInfos::GetEntityGroupByKey(const std::string& GroupKey)
	{
		return sEntityGroupsByKey[GroupKey];
	}

	SceneInfo* SceneInfos::GetEntityByKey(const std::string& GroupKey, const std::string& SceneKey)
	{
		return sEntitiesByKey[GroupKey][SceneKey];
	}

	bool SceneInfos::LevelGroupContainsSceneKey(const std::string& GroupKey, const std::string& SceneKey)
	{
		return std::find_if(sLevelsByGroup[GroupKey].begin(), sLevelsByGroup[GroupKey].end(), SceneInfoByKey{ SceneKey }) != sLevelsByGroup[GroupKey].end();
	}

	bool SceneInfos::EntityGroupContainsSceneKey(const std::string& GroupKey, const std::string& SceneKey)
	{
		return std::find_if(sEntitiesByGroup[GroupKey].begin(), sEntitiesByGroup[GroupKey].end(), SceneInfoByKey{ SceneKey }) != sEntitiesByGroup[GroupKey].end();
	}
